// ==UserScript==
// @name YouTube Preview Annihilator
// @namespace dhiya
// @description  ts script is here to kick those annoying youtube video previews to the curb, no matter what i did they never turned off so uhh heres a script
// @license MIT
// @author       Dhiya
// @match        *://*.youtube.com/*
// @grant        none
// @run-at       document-start
// @version 1.0.1
// @icon         data:image/png;base64,
// @downloadURL https://update.greasyfork.org/scripts/541545/YouTube%20Preview%20Annihilator.user.js
// @updateURL https://update.greasyfork.org/scripts/541545/YouTube%20Preview%20Annihilator.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // alright, let's get this party started! time to make those previews disappear... ts pmo
    function injectOurAwesomeStyle() {
        let styleSheet = document.createElement('style');
        styleSheet.id = 'youtube-preview-killer-style'; // a unique ID for our style
        styleSheet.innerHTML = `
            /* seriously, no more video previews. we mean it! */
            ytd-video-preview { display: none !important; }
            .ytd-thumbnail-overlay-loading-preview-renderer { display: none !important; }
            .ytp-inline-preview-ui { display: none !important; }
            .ytp-inline-preview-scrip { display: none !important; }
            #preview { display: none !important; }
            /* but hey, let's keep the time visible, that's actually useful. */
            ytd-thumbnail[now-playing] ytd-thumbnail-overlay-time-status-renderer.ytd-thumbnail { display: flex !important; }
            ytd-thumbnail[is-preview-loading] ytd-thumbnail-overlay-time-status-renderer.ytd-thumbnail { display: flex !important; }
        `;
        document.head.appendChild(styleSheet);
    }

    // inject our style right away, before youtube even knows what hit it!
    injectOurAwesomeStyle();

    // now, for the sneaky ones that try to pop up later... we're watching you!
    const previewObserver = new MutationObserver(mutations => {
        mutations.forEach(mutation => {
            if (mutation.addedNodes.length > 0) {
                // if our style sheet somehow got removed (rudeeeeeeee), let's put it back!!!!!!!!!!!
                if (!document.getElementById('youtube-preview-killer-style')) {
                    injectOurAwesomeStyle();
                }
                // and for any new elements that appear, zap their goofy ahh attempts
                mutation.addedNodes.forEach(node => {
                    if (node.nodeType === 1) { // only care about actual elements
                        if (node.matches('ytd-video-preview') ||
                            node.matches('.ytd-thumbnail-overlay-loading-preview-renderer') ||
                            node.matches('.ytp-inline-preview-ui') ||
                            node.matches('.ytp-inline-preview-scrip') ||
                            node.matches('#preview')) {
                            node.style.display = 'none !important';
                        }
                        // check inside new elements too, cos they can be tricky..kinda
                        node.querySelectorAll('ytd-video-preview, .ytd-thumbnail-overlay-loading-preview-renderer, .ytp-inline-preview-ui, .ytp-inline-preview-scrip, #preview').forEach(el => {
                            el.style.display = 'none !important';
                        });
                    }
                });
            }
        });
    });

    // keeping an eagle eye for changes
    previewObserver.observe(document.body, { childList: true, subtree: true });

    // one last thing: let's try to flip off youtube's own sybauuuuuuuuu


// inline playback setting. It might not always work, but hey, we tried!
    window.addEventListener("yt-page-data-updated", () => {
        const inlinePlaybackToggle = document.querySelector("ytd-toggle-navigation-item-renderer[label=\"Inline playback\"]");
        if (inlinePlaybackToggle && inlinePlaybackToggle.hasAttribute("toggled")) {
            inlinePlaybackToggle.click(); // give it a good click to turn it off
        }
    });

    // and that's a wrap... enjoy your peaceful, preview-free youtube experience

})();

